import { createApp } from 'vue';
import { createRouter, createWebHistory } from 'vue-router';
import routes from './route'; // Importez les routes depuis le fichier route.js

const router = createRouter({
  history: createWebHistory(),
  routes,
});

const app = createApp(routes[0]);

app.use(router);

app.mount('#app');




